import { TextField } from "@mui/material";

const HomePage = () => {
  return (
    <div
      style={{
        height: "100vh",
        width: "100%",
        background: "silver",
        display: "flex",
        flexDirection: "column",
      }}
    >
      <div style={{ flex: 2, display: "flex" }}>
        <div style={{ flex: 5, display: "flex" }}>
          <div
            style={{
              flex: 3.3,
              display: "flex",
              flexDirection: "column",
              justifyContent: "center",
              alignItems: "center",
            }}
          >
            <h1>BUYING PRICE</h1>
            <div
              style={{ height: "40%", width: "50%", border: "1px solid black" }}
            ></div>
          </div>
          <div
            style={{
              flex: 3.3,
              display: "flex",
              flexDirection: "column",
              justifyContent: "center",
              alignItems: "center",
            }}
          >
            <h1>SELLING PRICE</h1>
            <div
              style={{ height: "40%", width: "50%", border: "1px solid black" }}
            ></div>
          </div>
          <div
            style={{
              flex: 3.3,
              display: "flex",
              flexDirection: "column",
              justifyContent: "center",
              alignItems: "center",
            }}
          >
            <h1>PROFIT</h1>
            <div
              style={{ height: "40%", width: "50%", border: "1px solid black" }}
            ></div>
          </div>
        </div>
        <div
          style={{
            flex: 4,
            display: "flex",
            alignItems: "center",
            justifyContent: "center",
          }}
        >
          <TextField
            style={{ height: 80, width: "70%", padding: 20 }}
            placeholder="Search..."
            type="search"
          />
        </div>
      </div>
      <div
        style={{
          flex: 8,
          background: "gray",
          display: "flex",
          alignItems: "center",
          justifyContent: "center",
        }}
      >
        <div
          style={{
            height: "98%",
            width: "99%",
            background: "white",
            display: "flex",
            flexDirection: "column",
          }}
        >
          <div style={{ flex: 1, background: "skyblue" }}>
            <h4>BUYING PRICE</h4>
            <h4>BUYING QUANTITY</h4>
            <h4>SELLING PRICE</h4>
            <h4>SELLING QUANTITY</h4>
            <h4>CURRENCY</h4>
            <h4>INSERT DATE</h4>

            <h4></h4>
          </div>
          <div style={{ flex: 9 }}>table body</div>
        </div>
      </div>
    </div>
  );
};

export default HomePage;
